(2, 'Funko Pop! Marvel: Spider-Man Simbionte (Especial)', 'funko-pop-marvel-spider-man-simbionte-especial', 'Funko-Spiderman-Simbionte', 150, 40, '<p>Figura coleccionable Funko Pop! del universo Marvel, representando a Spider-Man en su versi&oacute;n simbionte.<br />\r\n<br />\r\nEsta figura exclusiva forma parte de una edici&oacute;n especial con detalles met&aacute;licos y base decorativa tem&aacute;tica. Ideal para fans de Marvel y coleccionistas Funko.<br />\r\n<br />\r\nAltura aproximada: 10 cm. Material: vinilo.<br />\r\n<br />\r\nEdici&oacute;n limitada con detalles &uacute;nicos y empaque especial de colecci&oacute;n.</p>', 'Figura Funko Pop! de Spider-Man con traje simbionte, edición especial con detalles metálicos y base temática.', 'products/DhdVBVqKH5PTZzBHLe2b1lREKP9UHk6einNdjX4e.jpg', 2, 0, '[{\"item_id\":1714412401001,\"item_text\":\"funko\"},{\"item_id\":1714412401002,\"item_text\":\"marvel\"},{\"item_id\":1714412401003,\"item_text\":\"spiderman\"}]', 2, 1, 3, 8, 19, '2024-01-13 08:42:59', '2025-11-06 21:35:32', NULL),
(3, 'Funko Pop! Disney: Elsa - Frozen 2 (Brilla en la Oscuridad)', 'funko-pop-disney-elsa-frozen-2-brilla-en-la-oscuridad', 'Funko-Elsa-Frozen2', 120, 30, '<p>Figura Funko Pop! de Elsa, inspirada en la pel&iacute;cula Frozen 2. Esta versi&oacute;n exclusiva brilla en la oscuridad, destacando su magia de hielo.<br />\r\n<br />\r\nPerfecta para fan&aacute;ticos de Disney y coleccionistas.<br />\r\n<br />\r\nMaterial: vinilo. Altura: 9.5 cm. Incluye base transparente.</p>', 'Figura Funko Pop! Elsa Frozen 2, versión que brilla en la oscuridad. Edición especial para coleccionistas.', 'products/rhCGsk3RfmiOSYFFfiOJ3XCH8i2NHDX6fqLvjNub.jpg', 2, 0, '[{\"item_id\":1714412501001,\"item_text\":\"funko\"},{\"item_id\":1714412501002,\"item_text\":\"disney\"},{\"item_id\":1714412501003,\"item_text\":\"frozen\"}]', 3, 31, NULL, NULL, 18, '2024-01-13 08:51:32', '2025-05-03 17:38:33', NULL),
(4, 'Funko Pop! Star Wars: The Mandalorian con Grogu', 'funko-pop-star-wars-the-mandalorian-con-grogu', 'Funko-Mandalorian-Grogu', 140, 35, '<p>Figura Funko Pop! del Mandaloriano sosteniendo a Grogu (Baby Yoda). Detalles realistas con armadura beskar y capa.<br />\r\n<br />\r\nUn art&iacute;culo imperdible para los seguidores de Star Wars y los coleccionistas de Funko.<br />\r\n<br />\r\nMaterial: vinilo. Tama&ntilde;o: 10 cm. Empaque con ventana.</p>', 'Figura Funko Pop! The Mandalorian con Grogu. Detalles únicos de armadura y diseño.', 'products/GRsxo8PZBEp1Fbgs3bgmCPi2CY4Fp8C4GAIlU8n8.webp', 2, 0, '[{\"item_id\":1714412601001,\"item_text\":\"funko\"},{\"item_id\":1714412601002,\"item_text\":\"star wars\"},{\"item_id\":1714412601003,\"item_text\":\"mandalorian\"}]', 1, 38, 10, 39, 25, '2024-01-22 16:19:54', '2025-05-03 18:35:31', NULL),
(5, 'Funko Pop! Gaming: Sonic The Hedgehog (Corriendo)', 'funko-pop-gaming-sonic-the-hedgehog-corriendo', 'Funko-Sonic-Corriendo', 130, 32, '<p>Funko Pop! inspirado en Sonic The Hedgehog en su cl&aacute;sica pose de velocidad. Figura din&aacute;mica basada en videojuegos retro.<br />\r\n<br />\r\nCon detalles pintados a mano y caja tem&aacute;tica de colecci&oacute;n. Ideal para amantes de SEGA y los cl&aacute;sicos del gaming.</p>', 'Figura Funko Pop! Sonic corriendo. Inspirada en videojuegos clásicos, edición dinámica.', 'products/TU7iaSExquWwGl0hTlYxDwafAbPV7MtVC2wnXKbe.jpg', 2, 0, '[{\"item_id\":1714412701001,\"item_text\":\"funko\"},{\"item_id\":1714412701002,\"item_text\":\"gaming\"},{\"item_id\":1714412701003,\"item_text\":\"sonic\"}]', 4, 1, 2, 5, 13, '2024-01-25 13:42:18', '2025-08-18 21:24:32', NULL),
