INSERT INTO `reviews` (`id`, `product_id`, `user_id`, `sale_detail_id`, `message`, `rating`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 101, 4, 47, 'El Funko Pop de Iron Man está en un excelente estado. La pintura es precisa y no tiene defectos. ¡Recomendado!', 5, '2024-02-09 10:37:47', '2024-02-09 15:52:59', NULL),
(2, 102, 4, 48, 'El Funko Pop de Darth Vader tiene una excelente calidad. Es un poco más grande de lo que esperaba, pero vale la pena.', 5, '2024-02-09 10:53:32', '2024-02-09 15:53:32', NULL),
(3, 103, 4, 45, 'El Funko Pop de Spider-Man está genial, aunque algunas piezas se sienten un poco frágiles. Aún así, es un gran coleccionable.', 4, '2024-02-09 10:55:36', '2024-02-09 15:55:36', NULL),
(4, 104, 4, 29, 'Buen Funko Pop. El detalle es increíble, y la figura se ve bien en cualquier estante.', 5, '2024-02-16 06:48:04', '2024-02-16 11:48:04', NULL),
(5, 105, 4, 30, 'Me llegó con la caja un poco dañada. El Funko está bien, pero la presentación no fue perfecta.', 3, '2024-02-16 06:48:17', '2024-02-16 11:48:17', NULL),
(6, 106, 4, 8, 'El Funko Pop de Batman tiene detalles fantásticos, pero un poco caro para lo que es.', 4, '2024-02-16 07:26:29', '2024-02-16 12:26:29', NULL),
(7, 107, 4, 20, 'El Funko de Harry Potter está muy bien hecho, pero no es tan estable como me gustaría. A veces se cae fácilmente.', 3, '2024-02-16 08:00:36', '2024-02-16 13:00:36', NULL),
(8, 3, 2, 2540, 'muy lindo funko', 4, '2025-08-22 22:48:30', '2025-08-22 22:48:30', NULL);
